window.bookSummaryJSON = "<p><b>You thought their story was over...but a love like theirs has no end.</b></p> <p>Fate doesn't own Jake McKallister. At least, that's what he tells himself. Life is better than ever. He's at the top of his game, performing to sold-out crowds the world over. He has his health and a solid, fun-loving family to keep him grounded.</p> <p>And he got the girl - the beautiful, quirky girl he's just made his wife.</p> <p>Yes, life is good. If only fate would stop screaming in his ear.</p> <p>Lucky is the best word for Casey McKallister. She has an awesome support system, a nerd's dream job at a prestigious accounting firm, and best of all, she's married to the hottest rock star to ever roam the Earth.</p> <p>Yes, life is perfect...until it all comes crashing down around her.</p> <p>They say love conquers all. That's what Jake and Casey are counting on.</p>"; 
